                "width : -webkit-calc(100% - 32px);",
                "width :    -moz-calc(100% - 32px);",
                "width :         calc(100% - 32px);",
            "}",
            ".gd-button#gd-login {",
                "bottom: 100px",
            "}",
            ".gd-button {",
                "display: block;",
                "width: 100%;",
                "margin: 16px 0;",
                "padding: 8px 0;",
